import $ from 'jquery';
$(document).ready(function(){ 
			 
    initPage();	
    
   
}); 
function showLoader(){   
	$(".loading").show();  
}

function hideLoader(){  
	$(".loading").hide();  
}//end of hideLoader


function initPage(){
    hideLoader();
}
